description:
In her darkest, most compelling adult feature film to date, director Nica Noelle takes you into the disturbing reality of Beth Jensen (Remy LaCroix), a young student who has numbed herself to the terrifying world she shares with emotionally tortured, much older Abe (Mark Davis. ) With an all-star cast that includes adult superstar Veronica Avluv and Indie film sensation James Deen, Nobody's Daughter asks terrible questions about the nautre of love and madness, and dares you to fill in the blanks.

